import "./App.css";
import axios from "axios";
import { useEffect, useState } from "react";
import { Routes, Route, Router } from 'react-router-dom';


import Home from "./pages/Home";

function App() {


  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path="/" element={<Home />} />

      </Routes>
      </Router>
    </div>
  );
}

export default App;
